import React from "react";

export const Product = ({ product }) => {
  return (
    <div className="productCard">
      <div className="productImg">
        <img src={product.thumbnail} alt={product.title} />
      </div>

      <p>{product.title}</p>
      <h5>1.5</h5>
    </div>
  );
};
